// AdminHome.js (React)

import React from 'react';
import { useState, useEffect } from 'react';
import './AdminHome.css';

const AdminHome = () => {
  const [happyCustomers, setHappyCustomers] = useState(0);
  const [fulfilledOrders, setFulfilledOrders] = useState(0);
  const [achievements, setAchievements] = useState(0);
  const [successfulJourney, setSuccessfulJourney] = useState(0);

  useEffect(() => {
    // Simulate fetching data
    setHappyCustomers(1234); // Example data
    setFulfilledOrders(5678);
    setAchievements(9);
    setSuccessfulJourney(3);
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      <div className="dashboard">
        <div className="stat">
          <h2>Happy Customers</h2>
          <p className="count">{happyCustomers}</p>
        </div>
        <div className="stat">
          <h2>Fulfilled Orders</h2>
          <p className="count">{fulfilledOrders}</p>
        </div>
        <div className="stat">
          <h2>Achievements</h2>
          <p className="count">{achievements}</p>
        </div>
        <div className="stat">
          <h2>Successful Journey</h2>
          <p className="count">{successfulJourney} years</p>
        </div>
      </div>
    </div>
  );
};

export default AdminHome;
